    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
      };

      const handleClose = () => {
        setOpen(false);
      };


    return (
        <Fab
            aria-label='info'
            color="secondary"
            onClick={handleClickOpen}
        >
            <InfoOutlinedIcon />
        </Fab>
    )

}
